#include "../matrix_lib/matrix_lib.h"
#include <gtest/gtest.h>
#include <cmath>

double dist(double pred, double exp) {
    return std::abs(exp - pred) / exp;
}

static double precision = 1e-7;

TEST(TestDet, basic) {
    matrix_lib::Matrix left;
    double result;

    left = matrix_lib::Matrix{{46,  30},
                              {-26, -1}};
    result = 734.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{-25, -11},
                              {28,  -19}};
    result = 783.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{45, 13},
                              {49, -43}};
    result = -2572.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{-30, -29},
                              {34,  2}};
    result = 926.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{31, -33},
                              {19, -37}};
    result = -520.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{32, 42},
                              {8,  -8}};
    result = -592.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{16, -32},
                              {0,  16}};
    result = 256.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{20,  44},
                              {-48, 3}};
    result = 2172.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{-31, -7},
                              {-11, -15}};
    result = 388.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);

    left = matrix_lib::Matrix{{-11, -24},
                              {17,  21}};
    result = 177.0;
    EXPECT_LT(dist(matrix_lib::det(left), result), precision);
}

